function submitNickname(){let n=document.querySelector("#nicknameInput"),t=document.querySelector("#nicknameErrorLabel");if(t.textContent="",n.value.length<3){t.textContent+="Nickname mus have at least 3 haracters";return}let i=n.value;localStorage.setItem("userNickname",JSON.stringify(i));console.log("Nickname submitted: "+i);window.location.href="/home/lobby/"}function onLobbyLoad(){console.log("Lobby loaded");let n=JSON.parse(localStorage.getItem("userNickname"));n||(window.location.href="/home/index/")}